import React from "react";
import FilterBox from "./FilterBox";

const FilterContainer = ({
  setDisplayOrders,
  displayOrders,
  setPolling,
  polling,
}) => {
  return (
    <React.Fragment>
      <div>
        <FilterBox filterID="polishing" polling="polling" />
        <FilterBox filterID="sizing" polling="polling" />
        <FilterBox filterID="lazer" polling="polling" />
        <FilterBox filterID="engraving" polling="polling" />
        <FilterBox filterID="plating" polling="polling" />
        <FilterBox filterID="rhodium" polling="polling" />
        <FilterBox filterID="cleaning" polling="polling" />
      </div>
    </React.Fragment>
  );
};

export default FilterContainer;
